	add("brachiation", "{\"term\":\"brachiation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Movement by swinging the arms from one hold to the next\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, National Research Council (U. S.), \u0027[http://books.google.com/books?id\u003dE1pCTOrhh6kC\u0026amp;pg\u003dPA23\u0026amp;dq\u003dbrachiation\u0026amp;sig\u003dgUWdfwQpymXnKMTSTEtUpKzCPrMThe Psychological Well-Being of Nonhuman Primates]\u0027, p. 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Species that normally move by \u0027\u0027brachiation\u0027\u0027 (swinging from hand to hand while hanging from supports) or vertical leaping and clinging require substantially different cage designs from conventional quadrapedal striders even if all are of similar body weight\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brachiologia", "{\"term\":\"brachiologia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βραχύς\u0027 (short) + \u0027λογία\u0027 (speech) compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Brevity in speech\", \"priority\":1}]}, \"synonyms\":{}}");

