	add("brachygrapher", "{\"term\":\"brachygrapher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|brachygraphy|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A writer who uses shorthand; a stenographer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1654\u0027\u0027, Edmund Gayton, \u0027Festivous notes on the history and adventures of the renowned Don Quixote\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He asked the \u0027\u0027brachygrapher\u0027\u0027 whether he wrote the notes of the sermon\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brachylogy", "{\"term\":\"brachylogy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{confix|brachy|logy|lang\u003den}}, from Ancient greek (to 1453) \u0027βραχυλογία\u0027 from \u0027βραχύς\u0027 (short) + \u0027λογία\u0027 (speech) compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"concise speech; laconis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several forms of omission of words, including the omission of an understood part of a phrase, as, the omission of \u0026quot;good\u0026quot; from \u0026quot;(good) morning!\u0026quot; (brachyology\", \"priority\":2}]}, \"synonyms\":{}}");

