	add("brachyology", "{\"term\":\"brachyology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027brachiologia\u0027 from Ancient greek (to 1453) \u0027βραχύς\u0027 (short) + \u0027λογία\u0027 (speech) compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A figure of speech that is an abbreviated expression, for example, the omission of \u0026quot;good\u0026quot; from \u0026quot;good morning!\u0026quot; (resulting in the abbreviated greeting \u0026quot;morning!\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1840\u0027\u0027, Georg Benedikt Winer, \u0027A grammar of the idioms of the Greek language of the New Testament\u0027, translated from German to English by J. H. Agnew and O. G. Ebbeke, page 442\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the words [...of] Acts x. 39. there might be a \u0027\u0027brachyology\u0027\u0027, in case the sense were: \u0027we are witnesses of all that he did, of this also, that they put him to death\u0027. But such an omission is not necessary\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027 September, w:Friedrich Eduard Ed. König, “Psalm cxviii 27b”, in James Hastings (editor), \u0027The Expository Times\u0027, Volume XI, Number 12, T. \u0026amp; T. Clark (publisher), [http://books.google.com/books?id\u003dB7kAAAAAMAAJ\u0026amp;pg\u003dPA566\u0026amp;dq\u003dbrachyology page 566\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"So also in Ps 118\u0026lt;sup\u0026gt;27\u0026lt;/sup\u0026gt; the preposition might include the verb ‘come,’ which connects itself so naturally with ‘until,’ and a poetical mode of expression, which is naturally disposed to vivid \u0027\u0027brachyology\u0027\u0027 (cf. Ps 118\u0026lt;sup\u0026gt;10b, 11b, 12b\u0026lt;/sup\u0026gt;), might discover a self-evident point in the circumstance that not the victims themselves but their blood, the precious part of them (Lv 17\u0026lt;sup\u0026gt;11\u0026lt;/sup\u0026gt;), is at last to touch the alter-horns\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1870\u0027\u0027, Philip Schaff (translator) in John Peter Lange, \u0027A commentary on the Holy Scriptures: critical, doctrinal, and homiletical\u0027, volume 7, page 68\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The only trouble is with \u0026quot;over all things;\u0026quot; what is His relation to them? Evidently that of Head also. No other view is admissible exegetically; the question becoming thus a purely grammatical one: Shall we accept a \u0027\u0027brachyology\u0027\u0027 and understand a second \u0027κεφαλην\u0027 before \u0027τη εκκλησια\u0027 (M\u0026lt;small\u0026gt;EYER\u0026lt;/small\u0026gt;, S\u0026lt;small\u0026gt;TIER\u0026lt;/small\u0026gt;, H\u0026lt;small\u0026gt;ODGE\u0026lt;/small\u0026gt; approvingly): \u0026quot;gave Him the Head over all things (to be the Head) to the church,\u0026quot; or\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, David Arthur deSilva, \u0027Perseverance in gratitude: a socio-rhetorical commentary on the Epistle \u0026quot;to the Hebrews\u0026quot;\u0027, page 468\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The author employs a \u0027\u0027brachyology\u0027\u0027 in the last phrase: the hearers of the phrase \u0026quot;than Abel\u0026quot; [...] will be able to fill this out as \u0026quot;than the blood of Abel\u0026quot; from the mention of \u0026quot;blood speaking\u0026quot; [...] in the preceding phrase\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Sang-Won (Aaron) Son, \u0027Corporate elements in Pauline anthropology: a study of the selected terms, idioms, and concepts in the lighy of Paul\u0027s usage and background\u0027, page 35\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The expression \u0026quot;being-in-Christ\u0026quot; is, therefore, according to Schweitzer, \u0026quot;merely a \u0027\u0027brachyology\u0027\u0027 for being partakers in the Mystical Body of Christ.\u0026quot\", \"priority\":11}]}, \"synonyms\":{}}");

