	add("bracket", "{\"term\":\"bracket\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"Latin\", \"old provençal (to 1500)\", \"transalpine gaulish\"], \"text\":\"From earlier \u0027bragget\u0027 probably from Middle french (ca. 1400-1600) \u0027braguette\u0027 from Old french (842-ca. 1400) \u0027braguette\u0027 (the opening in the fore part of a pair of breeches) from Old provençal (to 1500) \u0027braga\u0027 from Latin {{m|la|brāca||pants}}, from Transalpine gaulish {{m|cel-gau|*braca|*brāca|pants}}, perhaps from or related to similar forms in Proto-germanic compare Old english (ca. 450-1100) \u0027braccas\u0027 (pants) Old english (ca. 450-1100) {{m|ang|brōc||breeches}}, from Proto-indo-european {{m|ine-pro|*bʰrāg-}}, from {{m|ine-pro|*bʰreg-||to break, crack, split, divide}}. More at {{l/en|breech}}, {{l/en|britches}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fixture attached to a wall to hold up a shelf\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any intermediate object that connects a smaller part to a larger part, the smaller part typically projecting sideways from the larger part\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A short crooked timber, resembling a knee, used as a support\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The cheek or side of an ordnance carriage\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any of the characters \u0026quot;(\u0026quot;, \u0026quot;)\u0026quot;, \u0026quot;[\u0026quot;, \u0026quot;]\u0026quot;, \u0026quot;{\u0026quot;, \u0026quot;}\u0026quot;, and, in the area of computer languages, \u0026quot;\u0026lt;\u0026quot; and \u0026quot;\u0026gt;\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;(\u0026quot; and \u0026quot;)\u0026quot; specifically, the other forms above requiring adjectives for disambiguation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;[\u0026quot; and \u0026quot;]\u0026quot; specifically - opposed to the other forms of which have their own technical names\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Printed diagram of games in a tournament\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Prediction of the outcome of games in a tournament, used for betting purposes\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"One of several ranges of numbers\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"tax \u0027\u0027bracket\u0027\u0027\u0027, \u0027age \u0027\u0027bracket\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In artillery, the endangered region between two shell impacts (one long and one short). The next shell fired is likely to hit accurately\", \"priority\":12}]}, \"synonyms\":{}}");

