	add("bradycardia", "{\"term\":\"bradycardia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βραδύς\u0027 (slow) and \u0027καρδία\u0027 (heart)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of having a slow heartbeat, defined as under 60 beats per minute for an adult\", \"priority\":1}]}, \"synonyms\":{}}");

