	add("braggadocio", "{\"term\":\"braggadocio\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"After \u0027Braggadocchio\u0027, boastful character in w:Edmund Spenser|Edmund Spenser\u0027s \u0027s:The Faerie Queene|The Faerie Queene\u0027 (1590), apparently a pseudo-Italian coinage.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A braggart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"by\u003d title\u003d The Works of Sir Thomas Urquhart of Cromarty, url\u003d original\u003d chapter\u003d Εκσκυβαλαυρον (The section\u003d isbn\u003d edition\u003d publisher\u003d w:Thomas Maitland, Lord Thomas Maitland location\u003d editor\u003d volume\u003d page\u003d passage\u003d the Gasconads of France, Rodomontads of Spain, Fanfaronads of Italy, and \u0027\u0027Bragadochio\u0027\u0027 brags of all other countries, could no more astonish his invincible heart, then would the cheeping of a mouse a bear robbed of her whelps\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Empty boasting\", \"priority\":3}]}, \"synonyms\":{}}");

