	add("brail", "{\"term\":\"brail\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027braiel\u0027, from \u0027bracale\u0027 ‘girdle’ (from \u0027bracae\u0027 ‘breeches’).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small rope used to truss up sails\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A thong of soft leather to bind up a hawk\u0027s wing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A stock at each end of a seine to keep it stretched\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brain", "{\"term\":\"brain\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"ancient greek (to 1453)\", \"low german\", \"scots\"], \"text\":\"From Middle english (1100-1500) \u0027brain\u0027 from Old english (ca. 450-1100) {{m|ang|bræġen||brain}}, from Proto-germanic {{m|gem-pro|*bragną||brain}}, from Proto-indo-european {{m|ine-pro|*mreghmno-}}, {{m|ine-pro|*mreghmo-||skull, brain}}, from Proto-indo-european {{m|ine-pro|*mreK-||marrow, sinciput}}. Cognate with Scots \u0027braine\u0027 \u0027brane\u0027 (brain) Northern frisian \u0027brayen\u0027 \u0027brein\u0027 (brain) Saterland Frisian {{m|stq|Brainge||brain}}, West Frisian \u0027brein\u0027 (brain) Dutch \u0027brein\u0027 (brain) Low german \u0027brägen\u0027 () \u0027bregen\u0027 (brain) (whence German \u0027bregen\u0027 (animal brain) , Ancient greek (to 1453) \u0027βρεχμός\u0027 (front part of the skull, top of the head)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The control center of the central nervous system of an animal located in the skull which is responsible for perception, cognition, attention, memory, emotion, and action\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/lifeandstyle/2013/jul/08/irregular-bedtimes-affect-childrens-brains Irregular bedtimes may affect children\u0027s passage\u003dIrregular bedtimes may disrupt healthy \u0027\u0027brain\u0027\u0027 development in young children, according to a study of intelligence and sleeping habits.\u0026amp;nbsp; \u0026amp;para;\u0026amp;nbsp;Going to bed at a different time each night affected girls more than boys, but both fared worse on mental tasks than children who had a set bedtime, researchers found\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An intelligent person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who provides the intelligence required for something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Intellect\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008 Quaker Action\u0027\u0027 (magazine) \u0027Rights trampled in rush to deport immigrant workers\u0027, Fall 2008, Vol. 89, No. 3, p. 8\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;We provided a lot of \u0027\u0027brains\u0027\u0027 and a lot of heart to the response when it was needed,\u0026quot; says Sandra Sanchez, director of AFSC\u0027s Immigrants\u0027 Voice Program in Des Moines\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"By analogy with a human brain, the part of a machine or computer that performs calculations\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"oral se\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, featuring Turk and Mystikal, \u0027I\u0027m On It\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"You said I got \u0027\u0027brain\u0027\u0027 from your dame in the rang\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In the passing lan\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"But you really ain\u0027t got no proof\", \"priority\":13}]}, \"synonyms\":{}}");

	add("brailling", "{\"term\":\"brailling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|braille|ing|lang\u003den}}, an allusion to the system of writing for the blind that is read by touch.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of cheating in the board game Scrabble, where a player drawing tiles from the bag attempts to feel their raised surfaces so as to choose specific letters\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brainbox", "{\"term\":\"brainbox\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brain|box|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very intelligent person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The head or skull (which encloses the brain\", \"priority\":2}]}, \"synonyms\":{}}");

	add("brainchild", "{\"term\":\"brainchild\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|brain|child|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A creation, original idea, or innovation, usually used to indicate the originator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The entire project was the \u0027\u0027brainchild\u0027\u0027 of a small group of visionaries\", \"priority\":2}]}, \"synonyms\":{}}");

	add("braindance", "{\"term\":\"braindance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027brain\u0027 + \u0027dance\u0027, from its relatively complex (i.e. intellectual) structure and use of elements of dance music. Coined by the label Rephlex Records.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"IDM (intelligent dance music\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brainfuck", "{\"term\":\"brainfuck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brain|fuck|t2\u003dto play with; to tinker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that destabilizes, confuses, or manipulates a person\u0027s mind\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Dana Hodgdon, \u0027Adam\u0027s Theories\u0027, iUniverse (2004), ISBN 0595313353, [http://books.google.com/books?id\u003dQkpEs-8-PvwC\u0026amp;pg\u003dPA107 page 107\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"What a \u0027\u0027brainfuck\u0027\u0027. Little Roger, my brother, wanted to have a talk about sex\", \"priority\":3}]}, \"synonyms\":{\"list\":[{\"text\":\"headfuck\", \"synonymQualifier\":\"VULGAR\"},{\"text\":\"mindfuck\", \"synonymQualifier\":\"VULGAR\"}]}}");

	add("brainiac", "{\"term\":\"brainiac\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|brain|maniac|lang\u003den}}, with influence from ENIAC, the name of an early computer, coined in the Superman comic book. The term first appeared in w:Action Comics|Action Comics. 438 in July, 1958.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very intelligent and usually studious, erudite person\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brains", "{\"term\":\"brains\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The substance of a brain, the skull contents\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare, \u0027Macbeth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I would, while it was smiling in my face\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Have pluck\u0027d my nipple from his boneless gums\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And dash\u0027d the brains out, had I so sworn as yo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Have done to this\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"intelligence; aptitude; mental capability\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The brain of one or more animals used as food\", \"priority\":8}]}, \"synonyms\":{}}");

	add("brainstorm", "{\"term\":\"brainstorm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden thought, particularly one that solves a long-standing problem\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I had been working on the problem for weeks, and then I had a \u0027\u0027brainstorm\u0027\u0027 and saw that the solution was easy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"brainstormin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An unexpected mental error\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005, \u0026quot;Iguchi hit ruins Red Sox\u0027s night\u0026quot;, [http://news.bbc.co.uk/sport2/hi/other_sports/us_sport/4314228.stm BBC Online], 5 Octobe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A terrible fielding error from Tony Graffanino proved costly. [...] Aaron Rowand collected an RBI double to get them off the mark before Graffanino\u0027s \u0027\u0027brainstorm\u0027\u0027. Juan Uribe hit a roller to the second baseman, who let the potential inning-ending double-play ball roll under his glove, leaving runners at first and third bases\", \"priority\":6}]}, \"synonyms\":{}}");

	add("brainteaser", "{\"term\":\"brainteaser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brain|teaser|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A difficult problem or puzzle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brainwash", "{\"term\":\"brainwash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A calque of the Chinese {{l|1\u003dcmn|2\u003d洗脑|sc\u003dHans|tr\u003dxǐ nǎo}}, literally \u0026quot;to wash the brain\u0026quot;. Usage via U.S. military during w:Korean War|Korean War.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An effect upon one\u0027s memory, belief, or ideas\", \"priority\":1}]}, \"synonyms\":{}}");

	add("braiser", "{\"term\":\"braiser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|braise|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kettle or pan for braising\", \"priority\":1}]}, \"synonyms\":{}}");

	add("braize", "{\"term\":\"braize\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A European marine fish, \u0027Pagrus pagrus\u0027, allied to the American scup; the becker. The name is sometimes applied to the related species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A kind of small charcoal used for roasting ore\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027, H.R. Schubert, \u0027History of the British Iron and Steel Industry\u0027, p. 216\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fuel was wood, either alone or mixed with peat, or pure peat - as in the north of Lancashire - or mineral coal, but most frequently it was small charcoal, called braise or \u0027\u0027braize\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Meat cooked by braising\", \"priority\":5}]}, \"synonyms\":{}}");

