	add("brame", "{\"term\":\"brame\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\"], \"text\":\"From Middle english (1100-1500) {{m|enm|brame}}, from Old french (842-ca. 1400) {{m|fro|brame}}, {{m|fro|bram||a cry of pain or longing; a yammer}}, of Proto-germanic origin, compare Old High German {{m|goh|breman||to roar}}, Old English {{m|ang|bremman||to roar}}. More at {{l|en|brim}}. Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"sharp passion; vexatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Spenser, \u0027The Fairie Queene\u0027, Book III, Canto II, 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"hart-burning \u0027\u0027brame\u0027\u0027 / She shortly like a pyned ghost became\", \"priority\":3}]}, \"synonyms\":{}}");

	add("bramble", "{\"term\":\"bramble\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) \u0027brembel\u0027 from Old english (ca. 450-1100) \u0027bræmbel\u0027 from earlier \u0027brǣmel\u0027 \u0027brēmel\u0027 from dialectal Proto-germanic {{m|gem-pro|*brēmila-}} (compare West Frisian \u0027brommel\u0027 Flemish \u0027bramel\u0027 Low German \u0027brommelbeer\u0027 , diminutive of {{m|gem-pro|*brēm-}} (compare English \u0027broom\u0027 . More at {{l|en|broom}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Common blackberry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[https://openlibrary.org/works/OL10563347W The Three Corpse chapter\u003d5|passage\u003dThe hovel stood in the centre of what had once been a vegetable garden, but was now a patch of rank weeds. Surrounding this, almost like a zareba, was an irregular ring of gorse and \u0027\u0027brambles\u0027\u0027, an unclaimed vestige of the original common\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several closely related thorny plants in the genus \u0027Rubus\u0027, including blackberry and raspberry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any thorny shrub\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A cocktail of gin, lemon juice, and blackberry liqueur\", \"priority\":5}]}, \"synonyms\":{}}");

	add("brancher", "{\"term\":\"brancher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|branch|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which shoots forth branches; one who shows growth in various directions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A young owl or other raptor that is just too young to fly. So called because of the bird still clinging to the branches while practising flying movements with the wings.Category:en:Falconry\", \"priority\":2}]}, \"synonyms\":{}}");

	add("brandalism", "{\"term\":\"brandalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|brand|vandalism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The encroachment of ads, logos, and other types of corporate branding into public and traditionally non-commercial spaces, or the dissemination of corporate messages through methods or mediums not typically used for marketing purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mark Townsend, \u0026quot;[http://www.guardian.co.uk/media/2003/may/04/channel4.bigbrother Big Brother\u0027s logo \u0027defiles\u0027 White Horse ]\u0026quot;, \u0027The Observer\u0027, 4 May 2003\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But in what archaeologists describe as one of the most shameful instances of \u0027\u0027brandalism\u0027\u0027 seen in Britain, Channel 4 executives stand accused of defiling the oldest hill-chalk carving in Britain\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The deliberate defacement of corporate iconography, generally for purposes of protest, parody, or social commentary\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Steve Hemsley, \u0026quot;[http://www.mediaweek.co.uk/news/511891/sabotage-ad-campaign/ How to sabotage an ad campaign]\u0026quot;, \u0027MediaWeek\u0027, 1 February 2005\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It is, effectively, the opposite of so-called \u0026quot;\u0027\u0027brandalism\u0027\u0027\u0026quot; which is where advertisers have no control over how, where and when their branded communication is sabotaged\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For example, billboards in New York for Apple\u0027s iPod music player were defaced by one disgruntled customer with the words \u0026quot;iPod\u0027s unreplaceable battery lasts only 18 months\u0026quot; after he discovered it would cost more to buy a new battery than to purchase a new iPod\", \"priority\":7}]}, \"synonyms\":{}}");

	add("brandscaping", "{\"term\":\"brandscaping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|brand|landscaping|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The organization of physical space as an extension or representation of a brand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Otto Riewoldt, \u0027Brandscaping: Worlds of Experience in Retail Design\u0027, Birkhauser Verlag AG (June 2002), page 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Brandscaping\u0027\u0027 turns the brand itself into a location - an attraction\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brandwidth", "{\"term\":\"brandwidth\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|brand|bandwidth|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The level of brand recognition or market share enjoyed by a product, service, or company\", \"priority\":1}]}, \"synonyms\":{}}");

